function Social() {
    let arr = ["Face book","yahoo" ,"twitter" ];
    let u_l = `<ul>`;
    for(let i = 0 ;i < 3; i ++){
      ul+=`<li>
      <input type = "checkbox"></input>
      <label>${arr[i]}</label>
    </li>`
    } 
    u_l +="<ul>"
    return (
    u_l
    );
  }
  
  export default  Social;
